import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
  appBar: {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    background: "green",
  },
  heading: {
    color: "#fff",
    fontWeight: "bold",
    fontSize: 40,
  },
  image: {
    marginLeft: "px",
  },
}));
